import React, { useState } from 'react'
import Todo from './Todo'

function TodoList({ todos, todoDelete }) { //  recibimos la funcion todoDelete que viene desde App de aqui se la enviamos a cada todo y se la pasamos al componente Todo ver mas abajo
    // const [todos, setTodos] = useState(initialTodos)
    // nos llevamos a App

    return (
        <div>
            <h1>TodoList</h1>
            {
                todos.map(todo => (
                    <Todo
                        todo={todo}
                        key={todo.id}
                        todoDelete={todoDelete} //ahora ya la podemos usar en componente Todo
                    />
                ))
            }
        </div>
    )
}

export default TodoList
